    [],nt"revision_timestamp": "2016-04-19T01:16:21.576984",nt"name": "fema-hazard-mitigation-grant-program-summary",nt"isopen":
    false,nt"url": null,nt"notes": "The Hazard Mitigation Grant Program (HMGP,
    CFDA Number: 97.039) provides grants to States and local governments to implement
    long-term hazard mitigation measures after a major disaster declaration. The purpose
    of HMGP is to reduce the loss of life and property due to natural disasters and
    to enable mitigation measures to be implemented during the immediate recovery from
    a disaster. HMGP is available, when authorized under a Presidential major disaster
    declaration, in the areas of the State requested by the Governor.",nt"license_title":
